import React, { useState } from 'react';
import { FiCheck, FiX } from 'react-icons/fi';
import '../styles/Pricing.css';

const Pricing = () => {
  const [isAnnual, setIsAnnual] = useState(true);

  const plans = [
    {
      name: "Basic",
      price: isAnnual ? "$9.99" : "$12.99",
      period: isAnnual ? "/year" : "/month",
      description: "Perfect for small projects",
      features: [
        { included: true, text: "Up to 5 projects" },
        { included: true, text: "Basic support" },
        { included: true, text: "1GB storage" },
        { included: false, text: "Advanced analytics" },
        { included: false, text: "Priority support" }
      ],
      popular: false,
      color: "#6c63ff"
    },
    {
      name: "Pro",
      price: isAnnual ? "$29.99" : "$34.99",
      period: isAnnual ? "/year" : "/month",
      description: "Best for growing businesses",
      features: [
        { included: true, text: "Up to 50 projects" },
        { included: true, text: "Priority support" },
        { included: true, text: "10GB storage" },
        { included: true, text: "Advanced analytics" },
        { included: false, text: "Custom domain" }
      ],
      popular: true,
      color: "#36d1dc"
    },
    {
      name: "Enterprise",
      price: "Custom",
      period: "",
      description: "For large organizations",
      features: [
        { included: true, text: "Unlimited projects" },
        { included: true, text: "24/7 support" },
        { included: true, text: "Unlimited storage" },
        { included: true, text: "Advanced analytics" },
        { included: true, text: "Custom domain" }
      ],
      popular: false,
      color: "#ff6584"
    }
  ];

  return (
    <section id="pricing" className="pricing">
      <div className="container">
        <h2 className="section-title">Simple, <span className="text-gradient">Transparent</span> Pricing</h2>
        <p className="section-subtitle">
          Choose the plan that's right for you. All plans include a 30-day money-back guarantee.
        </p>

        <div className="pricing-toggle">
          <span className={!isAnnual ? "active" : ""}>Monthly</span>
          <div className="toggle-switch" onClick={() => setIsAnnual(!isAnnual)}>
            <div className={`toggle-slider ${isAnnual ? "annual" : "monthly"}`}></div>
          </div>
          <span className={isAnnual ? "active" : ""}>Annual <span className="discount-badge">Save 20%</span></span>
        </div>

        <div className="pricing-cards">
          {plans.map((plan, index) => (
            <div 
              key={index} 
              className={`pricing-card ${plan.popular ? "popular" : ""}`}
              style={{ '--plan-color': plan.color } }
            >
              {plan.popular && <div className="popular-badge">Most Popular</div>}

              <div className="plan-header">
                <h3>{plan.name}</h3>
                <div className="plan-price">
                  <span className="price">{plan.price}</span>
                  <span className="period">{plan.period}</span>
                </div>
                <p className="plan-description">{plan.description}</p>
              </div>

              <div className="plan-features">
                {plan.features.map((feature, idx) => (
                  <div key={idx} className="feature">
                    {feature.included ? (
                      <FiCheck className="feature-icon included" />
                    ) : (
                      <FiX className="feature-icon excluded" />
                    )}
                    <span>{feature.text}</span>
                  </div>
                ))}
              </div>

              <a 
                href="#" 
                className="btn"
                style={{
                  background: plan.popular ? `linear-gradient(135deg, ${plan.color} 0%, #36d1dc 100%)` : "transparent",
                  color: plan.popular ? "white" : plan.color,
                  border: `2px solid ${plan.color}`
                }}
              >
                {plan.name === "Enterprise" ? "Contact Sales" : "Get Started"}
              </a>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Pricing;
